import React, { useState, useEffect } from "react";
import logo from '../logo.svg';

function Signup() {
  
  return (
    <div className="Signup">
      <form>
        <label for="nombre">Nombre</label>
        <input type="text" id="nombre"/>
      </form>
    </div>
  );
}

export default Signup;
